css:
atom-text-editor,
:host {
  background-color: #f8f1e5;
  color: #2f3131;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #2f3131;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #666666;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #9d9ea1;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #426e86;
  color: #f8f1e5;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #9db0b6;
  color: #ededed;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #ededed;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #7b2f26;
}
atom-text-editor .invisible,
:host .invisible {
  color: #2f3131;
}
atom-text-editor .cursor,
:host .cursor {
  color: #2f3131;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #fcd566;
}
atom-text-editor .punctuation.tag.html,
:host .punctuation.tag.html {
  color: #996699;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #9d9ea1;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #fffbef;
}
.comment {
  color: #7b2f26;
}
.entity.name.type {
  color: #3366cc;
  text-decoration: underline;
}
.entity.other.inherited-class {
  color: #56a076;
}
.keyword {
  color: #7b2f26;
}
.keyword.control {
  color: #7b2f26;
}
.keyword.operator {
  color: #2f3131;
}
.keyword.other.special-method {
  color: #7b2f26;
}
.keyword.other.unit {
  color: #94918b;
}
.storage {
  color: #7b2f26;
}
.constant {
  color: #94918b;
}
.constant.character.escape {
  color: #996699;
}
.constant.numeric {
  color: #94918b;
}
.constant.other.color {
  color: #996699;
}
.constant.other.symbol {
  color: #56a076;
}
.variable {
  color: #996699;
}
.variable.interpolation {
  color: #7a527a;
}
.variable.parameter.function {
  color: #2f3131;
}
.invalid.illegal {
  background-color: #996699;
  color: #f8f1e5;
}
.string {
  color: #56a076;
}
.string.regexp {
  color: #56a076;
}
.string.regexp .source.ruby.embedded {
  color: #c58700;
}
.string.other.link {
  color: #996699;
}
.punctuation.definition.comment {
  color: #7b2f26;
}
.punctuation.definition.string,
.punctuation.definition.variable,
.punctuation.definition.parameters,
.punctuation.definition.array {
  color: #c58700;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #7b2f26;
}
.punctuation.definition.bold {
  color: #3366cc;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #7b2f26;
  font-style: italic;
}
.punctuation.section.embedded {
  color: #7a527a;
}
.support.class {
  color: #3366cc;
}
.support.function {
  color: #996699;
}
.support.function.any-method {
  color: #7b2f26;
}
.entity.name.function {
  color: #7b2f26;
}
.entity.name.class,
.entity.name.type.class {
  color: #3366cc;
}
.entity.name.section {
  color: #7b2f26;
}
.entity.name.tag {
  color: #996699;
}
.entity.other.attribute-name {
  color: #c58700;
}
.entity.other.attribute-name.id {
  color: #7b2f26;
}
.meta.class {
  color: #3366cc;
}
.meta.link {
  color: #c58700;
}
.meta.require {
  color: #7b2f26;
}
.meta.selector {
  color: #7b2f26;
}
.meta.separator {
  background-color: #94918b;
  color: #2f3131;
}
.none {
  color: #2f3131;
}
.markup.bold {
  color: #c58700;
  font-weight: bold;
}
.markup.changed {
  color: #7b2f26;
}
.markup.deleted {
  color: #996699;
}
.markup.italic {
  color: #7b2f26;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #7b2f26;
}
.markup.inserted {
  color: #56a076;
}
.markup.list {
  color: #996699;
}
.markup.quote {
  color: #c58700;
}
.markup.raw.inline {
  color: #56a076;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #56a076;
}
.scroll-view .lines .line.cursor-line {
  color: #426e86;
  background-color: #fffbef;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
